import React from 'react'
import { Box, Divider } from '@mui/material'

function UnitColumn(props) {
  return (
    <Box sx={{
        display: 'flex',
        height: '600px',
        width: '150px',
        bgcolor: "#0B3C5D"
    }}>
        <img src={require('../img/ships/Cruiser.png')} alt="" style={{height: '50px'}}/>
        <Divider sx={{color: 'white'}}/>
    </Box>
  )
}

export default UnitColumn
